import React, {Component} from 'react';
import {Button} from 'react-bootstrap';

export default class addRunnerComponentButton extends Component{

    state = {
        on: false
    }


    render() {
        return (
            <div>
            <Button variant="danger">
                Primary
            </Button>
            </div>
        )
    }
}
